"use strict";function initUserList(e){var s=e.length;if(s)for(var t=0;t<s;t++)addUser(e[t])}function addUser(e){userList.append('<li id="'+e.id+'" >'+e.name+"</li>")}var socket=io(),userList=jQuery("#users");socket.on("connect",function(){jQuery.get("/getUserList",function(e){initUserList(e);var s=prompt("What's your name?");socket.emit("create:user",s,function(e){addUser(e),console.log("User "+e.name+" has been registered and was assigned the id "+e.id)})})}),socket.on("user:created",function(e){addUser(e)}),socket.on("create:user",function(e){console.log(e)});